import React from 'react';
import Image from 'next/image';
import { keyframes } from '@emotion/react';

import NotificationsNoneOutlinedIcon from '@mui/icons-material/NotificationsNoneOutlined';
import SettingsIcon from '@mui/icons-material/Settings';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Stack from '@mui/material/Stack';
import Typography from '@mui/material/Typography';

import InteractionButton, { InteractionType } from '@/components/common/InteractionButton';

interface NotificationBannerProps {
  registerPushNotifications: () => void;
  hidePushSubscriptionAlert: ({ rememberAfterPageReload }: { rememberAfterPageReload: boolean }) => void;
  showManualSteps: boolean;
}

interface BuildNotificationBannerProps {
  dismissAction: () => void;
  action: () => void;
  text: string;
  dismissText: string;
  okText: string;
  image: () => React.ReactNode | string;
  icon?: React.ReactNode;
}

const BuildNotificationBanner = (props: BuildNotificationBannerProps) => {
  const { dismissAction, action, text, dismissText, okText, image, icon } = props;
  const animation = keyframes`
      0% {
          opacity: 0;
          transform: translateY(-50px);
      }

      100% {
          opacity: 1;
          transform: translateY(0);
      }`;
  return (
    <Paper
      elevation={1}
      sx={{
        position: 'fixed',
        maxWidth: '534px',
        animation: `${animation} 800ms cubic-bezier(0.87, 0, 0.13, 1) 0s 1 normal forwards`,
      }}
      style={{
        marginTop: '100px',
        marginRight: '36px',
        borderRadius: '16px',
        zIndex: 5,
        display: 'inline-flex',
        padding: 'var(--5, 40px)',
        flexDirection: 'column',
      }}
    >
      <Stack direction="row" alignItems={'start'} gap={1} style={{ borderRadius: '12px' }}>
        <Box marginLeft={'20px'}>{icon}</Box>
        <Box>
          <Typography
            variant={'body1'}
            color={'text.primary'}
            sx={{ fontSize: '16px', fontFamily: '***FONT_REMOVED***' }}
          >
            {text}
          </Typography>
        </Box>
      </Stack>
      <Box>{image()}</Box>
      <Stack direction={'row'} alignSelf={'flex-end'} spacing={'8px'}>
        <InteractionButton interactionType={InteractionType.OK} label={okText} onClick={action}>
          {okText}
        </InteractionButton>
        <InteractionButton interactionType={InteractionType.DISMISS} label={dismissText} onClick={dismissAction}>
          {dismissText}
        </InteractionButton>
      </Stack>
    </Paper>
  );
};
export const NotificationBanner = (props: NotificationBannerProps) => {
  const { registerPushNotifications, hidePushSubscriptionAlert, showManualSteps } = props;
  return showManualSteps
    ? BuildNotificationBanner({
        dismissAction: () => hidePushSubscriptionAlert({ rememberAfterPageReload: false }),
        action: registerPushNotifications,
        text: 'Dein Browser verhindert die Aktivierung von Benachrichtigungen. Bitte gehe zu den Einstellungen, um die Aktivierung zu ermöglichen um Benachrichtigungen zu erhalten: Settings → Cookies and site permissions → Notifications',
        dismissText: 'Später erinnern',
        okText: 'Erledigt',
        icon: <SettingsIcon />,
        image: () => (
          <Image
            src={'/images/manually_enable_notifications.png'}
            width={550}
            height={80}
            alt={'Notification Settings'}
          />
        ),
      })
    : BuildNotificationBanner({
        dismissAction: () => hidePushSubscriptionAlert({ rememberAfterPageReload: true }),
        action: registerPushNotifications,
        text: 'Dürfen wir dir Benachrichtigungen senden?',
        dismissText: 'Nein',
        okText: 'Ja',
        icon: <NotificationsNoneOutlinedIcon />,
        image: () => simpleNotificationBanner(),
      });
  //image: simpleNotificationBanner,
};

